  /**
   * Prueba unitaria para el algoritmo de Dice
   * 
   * Primero se carga la imagen llamada firstTest.png, ubicada en la carpeta llamada imagenesPrueba (De este proyecto).
   * Luego se segmenta y se calcula el coeficiente de dice con ella misma, el resultado debe ser igual a 1,0.
   * @author Ariel Rodríguez arieli13.10@gmail.com
   * @throws Exception Puede tirar excepción el codificador, kittler y la segmentación.
   */
  @Test
  public void firstTest() throws Exception{
    String imagenCodificada = "";
    ImagenCodificador codificador = ImagenCodificadorCreador.crearImagenCodificador(AlgoritmoCodificacion.BASE64_TOMCAT);
    ImagenMatOpenCv imagen = (ImagenMatOpenCv) ImagenCreador.crearImagen(codificador.decodificarImagen(imagenCodificada), TipoImagen.OPENCV, "Ejemplo", "png");
    imagen.toGreyScale();
    Kittler k = new Kittler();
    k.ejecutar(imagen);
    Segmentacion z = new Segmentacion(20);
    z.ejecutarSinEtiqueta(imagen);
    double dice = imagen.coeficienteDice(imagen);
    assertEquals(dice, 1.0, 0);
  }
  
  /**
   * Prueba unitaria para el algoritmo de Dice
   * 
   * Primero se carga una imagen segmentada manualmente y posteriormente la imagen original sin ser segmentada.
   * Después de cargar las imágenes, la que no ha sido segmentada se segmenta y luego se calcula el coeficiente
   * de Dice entre ambas imágenes. Se espera que sea mayor a 0,1.
   * @author José Pablo Navarro j.pablonavarro95@gmail.com
   * @throws Exception Puede tirar excepción el codificador, kittler y la segmentación.
   */
  @Test
  public void secondTest() throws Exception{
    String segmentadaManual = "";
    String imagenOriginal = "";
    ImagenCodificador codificador = ImagenCodificadorCreador.crearImagenCodificador(AlgoritmoCodificacion.BASE64_TOMCAT);
    ImagenMatOpenCv imagen = (ImagenMatOpenCv) ImagenCreador.crearImagen(codificador.decodificarImagen(imagenOriginal), TipoImagen.OPENCV, "Ejemplo", "png");
    ImagenMatOpenCv imagenManual = (ImagenMatOpenCv) ImagenCreador.crearImagen(codificador.decodificarImagen(segmentadaManual), TipoImagen.OPENCV, "Ejemplo", "png");
    imagen.toGreyScale();
    imagenManual.toGreyScale();
    Kittler k = new Kittler();
    k.ejecutar(imagen);
    Segmentacion z = new Segmentacion(50);
    z.ejecutarSinEtiqueta(imagen);
    double dice = imagen.coeficienteDice(imagenManual);
    assertTrue(dice>0.1);
  }
  
