  /**
   * Prueba unitaria para el conteo de células.
   * 
   * Primero se carga la imagen llamada fourthTest.png, ubicada en la carpeta llamada imagenesPrueba (De este proyecto).
   * Luego se le aplica el algorimo de Kittler y se segmenta. Se obtiene el número de células encontradas por el 
   * algoritmo y se asegura que esté entre 80 y 100. Manualmente se encontraron 90, la incertidumbre esperada es de +-10.
   * @author Ariel Rodríguez arieli13.10@gmail.com
   * @throws Exception Pueden tirar error el codificador, kittler y la segmentación.
   */
  @Test
  public void fourthTest() throws Exception{
    String imagenCodificada = "";
    ImagenCodificador codificador = ImagenCodificadorCreador.crearImagenCodificador(AlgoritmoCodificacion.BASE64_TOMCAT);
    ImagenMatOpenCv imagen = (ImagenMatOpenCv) ImagenCreador.crearImagen(codificador.decodificarImagen(imagenCodificada), TipoImagen.OPENCV, "Ejemplo", "png");
    imagen.toGreyScale();
    Kittler k = new Kittler();
    k.ejecutar(imagen);
    Segmentacion z = new Segmentacion(40);
    z.ejecutarSinEtiqueta(imagen);
    int cantCelulas = z.cantCelulas;
    assertTrue(cantCelulas>=80 && cantCelulas<=100); //Manualmente se contaron 90, se acepta un intervalo de +-10
  }
  
